import React, { useState } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Axios from 'axios';

function App() {

  const [id, setId ] = useState('');
  const [name,setName] = useState('');
  const [emcode, setEmcode] = useState('');
  const [salary, setSalary] = useState('');

  const buttonClicked = () =>{
    let url = "http://localhost:6060";
    Axios.post(`${url}/employees`);
  }

  return (
    <div className="container">
      <div class="row">
        <div className="title col-sm">
          <h1>Hello world!!</h1>
        </div>
      </div>
      <div className="form row">
        <div class="row">
          <div class="col-sm">
            <input type="text" name="id" placeholder="id" onChange={(e) => {setId(e.target.value)}}/>
          </div>
          <div class="col-sm">
            <input type="text" name="name" placeholder="name" onChange={(e) => {setName(e.target.value)}} />
          </div>
          <div class="col-sm">
            <input type="text" name="emcode" placeholder="code" onChange={(e) => {setEmcode(e.target.value)}} />
          </div>

          <div class="col-sm">
            <input type="text" name="salary" placeholder="salary" onChange={(e) => {setSalary(e.target.value)}} />
          </div>
        </div>
        <div className="row">
          <div class="submit-button col-sm">
            <button className="btn btn-primary"
                    onClick={buttonClicked}
                    >Submit
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
